import React from 'react'
const person = (props)=>{
    return(
        <div>
            <h3>我的名字叫{props.name}</h3>
            <input type = "text" defaultValue = {props.name}/>
            <p onClick={props.showTip}>{props.children}</p>
        </div>
    )
}
export default person
